import React from 'react';
import './App.css';

import {Container, Row, Col} from 'react-bootstrap';
import {StyleSheet} from 'react-native';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';

import NavigationBar from './component/NavigationBar'
import BannerList from './component/BannerList'
import AddBanner from './component/AddBanner'
import CategoryList from './component/CategoryList'
import AddCategory from './component/AddCategory'

function App() {
  return (
    <Router>
      <NavigationBar/>
      <Container>
        <Row>
          <Col lg={true} style={styles.app}>
            <Routes>
              <Route exact path="/" element={<BannerList/>} />
              <Route exact path="/addBanner" element={<AddBanner/>} />
              <Route exact path="/category" element={<CategoryList/>} />
              <Route exact path="/category/AddCategory" element={<AddCategory/>} />
            </Routes>
          </Col>
        </Row>
      </Container>
    </Router>
  );
}

const styles = StyleSheet.create({
    app: {
        backgroundColor: 'white'
    },

});

export default App;
